  return (
    <BannerCtaWrap>
      <div
        className="banner-cta align-center-v theme-2"
        style={{ backgroundColor: "#a3ce37",

        }}
      >
        <div className="banner-cta__content">
          <h2 style={{color:"#ffffff"}}>Welcome Tutor</h2>
          <p>Please fill your personal information</p>

        </div>
      </div>
    </BannerCtaWrap>
  );
};

export {
  Banner1,
  Banner2,
  Banner3,
  Banner4,
  Banner5,
  Banner6,
  Banner7,
  BannerCarousel,
  BannerLong,
  BannerCard,
  BannerCard2,
  BannerCta,
  BannerCta2,
  BannerCta3,
  HomepageWelcome,
};
